  grid: {
    width: '1700px',
    margin: '0px',
  },

  paper: {
    padding: theme.spacing(2),
    width: '286px',
    height: '500px',
    display: 'flex',

    textAlign: 'center',
    color: theme.palette.text.secondary,
    background: theme.palette.success.light,
  }
}));

